import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import Entry from "./Entry";
function App(){
    return <div>
        <Header/>
        <Note
            title= "This is title"
            content="this is content"
        />
        <Footer/>
    </div>
}
export default App;
